def priority(item: float, bins: np.ndarray) -> np.ndarray:
    """Returns priority with which we want to add item to each bin.

    Args:
        item: Size of item to be added to the bin.
        bins: Array of capacities for each bin.

    Return:
        Array of same size as bins with priority score of each bin.
    """
    priorities = np.zeros(len(bins))

    for i in range(len(bins)):
        if bins[i] >= item:
            priorities[i] = 1
        else:
            remaining_capacity = bins[i]
            for j in range(i+1, len(bins)):
                if bins[j] >= item:
                    priorities[j] = (j - i) + 1
                    break
                else:
                    remaining_capacity += bins[j]
                    if remaining_capacity >= item:
                        priorities[j] = (j - i) + 1
                        break
                    elif j == len(bins) - 1:
                        highest_priority = -1
                        highest_priority_idx = -1
                        for k in range(i, j):
                            if priorities[k] == -1:
                                continue
                            if priorities[k] > highest_priority:
                                highest_priority = priorities[k]
                                highest_priority_idx = k
                        if highest_priority > 1:
                            priorities[highest_priority_idx] = 1
                            priorities[j] = (j - highest_priority_idx) + 1
                        else:
                            priorities[i] = -1
                            break

    return priorities
